import React, { useEffect, useState } from 'react';
import CameraFeed from '../components/AR/CameraFeed';
import PoseOverlay from '../components/AR/PoseOverlay';
import ClothingOverlay from '../components/AR/ClothingOverlay';
import { PoseProvider } from '../components/AR/PoseContext';

const OOTD: React.FC = () => {
  
  const [clothingImage, setClothingImage] = useState<string | null>(null); // Base64 string for clothing image
  // Fetch clothing image from backend (MongoDB via API)
  useEffect(() => {
    const fetchClothingImage = async () => {
      try {
        const response = await fetch('http://localhost:3000/image-clothing/fetch');
        if (!response.ok) {
          throw new Error(`Failed to fetch clothing image: ${response.statusText}`);
        }
  
        const data = await response.json();
        console.log('Fetched Base64 Image:', data);
  
        if (!data.base64Image) {
          console.error('Base64 image is missing in the API response:', data);
          return;
        }
  
        const fullBase64Image = data.base64Image.startsWith('data:image/')
          ? data.base64Image
          : `data:image/png;base64,${data.base64Image}`;
  
        setClothingImage(fullBase64Image);
      } catch (error) {
setClothingImage("data:image/jpeg;base64,");        console.error('Error fetching clothing image:', error);
      }
    };
  
    fetchClothingImage();
  
  }, []);  


  const [aiResponse, setAiResponse] = useState<string | null>(null);
  useEffect(() => {
  // Fetch data from the /gemini route
  const fetchAIResponse = async () => {
    console.log(setClothingImage);
    try {
      const response = await fetch('http://localhost:3000/gemini', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ image: setClothingImage }), // Send base64 image data
      });
      const data = await response.json();
      setAiResponse(data); // Assuming the backend sends the response as plain text
    } catch (error) {
      console.error('Error fetching AI response:', error);
    }
  };
  fetchAIResponse();
  }, []);


  return (
    <PoseProvider>
      <div className="relative w-[1920] h-[1000]" style={{ zIndex: 1 }}>
        <CameraFeed />
        <PoseOverlay />
        <ClothingOverlay />
        {aiResponse && (
          <div className="absolute top-0 left-0 bg-white p-4 rounded shadow">
            <h3 className="text-lg font-bold">AI Response</h3>
            <p>{aiResponse}</p>
          </div>
        )}
      </div>
    </PoseProvider>
  );
};

export default OOTD;
